INSERT INTO `Challenges` VALUES (1,'restfulXssChallenge','API-only XSS','XSS','Danger Zone','Perform a <i>persisted</i> XSS attack with <code>&lt;iframe src=\"javascript:alert(`xss`)\"&gt;</code> without using the frontend application at all.',3,'You need to work with the server-side API directly. Try different HTTP verbs on different entities exposed through the API.','https://pwning.owasp-juice.shop/part2/xss.html#perform-a-persisted-xss-attack-without-using-the-frontend-application-at-all','https://cheatsheetseries.owasp.org/cheatsheets/Cross_Site_Scripting_Prevention_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(2,'accessLogDisclosureChallenge','Access Log','Sensitive Data Exposure',NULL,'Gain access to any access log file of the server.',4,'Who would want a server access log to be accessible through a web application?','https://pwning.owasp-juice.shop/part2/sensitive-data-exposure.html#gain-access-to-any-access-log-file-of-the-server','https://cheatsheetseries.owasp.org/cheatsheets/Logging_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(3,'registerAdminChallenge','Admin Registration','Improper Input Validation',NULL,'Register as a user with administrator privileges.',3,'You have to assign the unassignable.','https://pwning.owasp-juice.shop/part2/improper-input-validation.html#register-as-a-user-with-administrator-privileges','https://cheatsheetseries.owasp.org/cheatsheets/Mass_Assignment_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(4,'adminSectionChallenge','Admin Section','Broken Access Control','Good for Demos','Access the administration section of the store.',2,'It is just slightly harder to find than the score board link.','https://pwning.owasp-juice.shop/part2/broken-access-control.html#access-the-administration-section-of-the-store','https://cheatsheetseries.owasp.org/cheatsheets/Access_Control_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(5,'fileWriteChallenge','Arbitrary File Write','Vulnerable Components','Danger Zone,Prerequisite','Overwrite the <a href=\"/ftp/legal.md\">Legal Information</a> file.',6,'Look out for a tweet praising new functionality of the web shop. Then find a third party vulnerability associated with it.','https://pwning.owasp-juice.shop/part2/vulnerable-components.html#overwrite-the-legal-information-file','https://cheatsheetseries.owasp.org/cheatsheets/Vulnerable_Dependency_Management_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(6,'resetPasswordBjoernOwaspChallenge','Bjoern\'s Favorite Pet','Broken Authentication','OSINT','Reset the password of Bjoern\'s OWASP account via the <a href=\"/#/forgot-password\">Forgot Password</a> mechanism with <i>the original answer</i> to his security question.',3,'He might have spoilered it on at least one occasion where a camera was running. Maybe elsewhere as well.','https://pwning.owasp-juice.shop/part2/broken-authentication.html#reset-the-password-of-bjoerns-owasp-account-via-the-forgot-password-mechanism','https://cheatsheetseries.owasp.org/cheatsheets/Choosing_and_Using_Security_Questions_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(7,'tokenSaleChallenge','Blockchain Hype','Security through Obscurity','Contraption,Code Analysis','Learn about the Token Sale before its official announcement.',5,'The developers truly believe in \"Security through Obscurity\" over actual access restrictions.','https://pwning.owasp-juice.shop/part2/security-through-obscurity.html#learn-about-the-token-sale-before-its-official-announcement',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(8,'rceChallenge','Blocked RCE DoS','Insecure Deserialization','Danger Zone','Perform a Remote Code Execution that would keep a less hardened application busy <em>forever</em>.',5,'The feature you need to exploit for this challenge is not directly advertised anywhere.','https://pwning.owasp-juice.shop/part2/insecure-deserialization.html#perform-a-remote-code-execution-that-would-keep-a-less-hardened-application-busy-forever','https://cheatsheetseries.owasp.org/cheatsheets/Denial_of_Service_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(9,'captchaBypassChallenge','CAPTCHA Bypass','Broken Anti Automation','Brute Force','Submit 10 or more customer feedbacks within 10 seconds.',3,'After finding a CAPTCHA bypass, write a script that automates feedback submission. Or open many browser tabs and be really quick.','https://pwning.owasp-juice.shop/part2/broken-anti-automation.html#submit-10-or-more-customer-feedbacks-within-10-seconds',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(10,'changePasswordBenderChallenge','Change Bender\'s Password','Broken Authentication',NULL,'Change Bender\'s password into <i>slurmCl4ssic</i> without using SQL Injection or Forgot Password.',5,'In previous releases this challenge was wrongly accused of being based on CSRF.','https://pwning.owasp-juice.shop/part2/broken-authentication.html#change-benders-password-into-slurmcl4ssic-without-using-sql-injection-or-forgot-password',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(11,'christmasSpecialChallenge','Christmas Special','Injection',NULL,'Order the Christmas special offer of 2014.',4,'Find out how the application handles unavailable products and try to find a loophole.','https://pwning.owasp-juice.shop/part2/injection.html#order-the-christmas-special-offer-of-2014','https://cheatsheetseries.owasp.org/cheatsheets/SQL_Injection_Prevention_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(12,'usernameXssChallenge','CSP Bypass','XSS','Danger Zone','Bypass the Content Security Policy and perform an XSS attack with <code>&lt;script&gt;alert(`xss`)&lt;/script&gt;</code> on a legacy page within the application.',4,'What is even \"better\" than a legacy page with a homegrown RegEx sanitizer? Having CSP injection issues on the exact same page as well!','https://pwning.owasp-juice.shop/part2/xss.html#bypass-the-content-security-policy-and-perform-an-xss-attack-on-a-legacy-page','https://cheatsheetseries.owasp.org/cheatsheets/Cross_Site_Scripting_Prevention_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(13,'persistedXssUserChallenge','Client-side XSS Protection','XSS','Danger Zone','Perform a <i>persisted</i> XSS attack with <code>&lt;iframe src=\"javascript:alert(`xss`)\"&gt;</code> bypassing a <i>client-side</i> security mechanism.',3,'Only some input fields validate their input. Even less of these are persisted in a way where their content is shown on another screen.','https://pwning.owasp-juice.shop/part2/xss.html#perform-a-persisted-xss-attack-bypassing-a-client-side-security-mechanism','https://cheatsheetseries.owasp.org/cheatsheets/Cross_Site_Scripting_Prevention_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(14,'directoryListingChallenge','Confidential Document','Sensitive Data Exposure','Good for Demos','Access a confidential document.',1,'Analyze and tamper with links in the application that deliver a file directly.','https://pwning.owasp-juice.shop/part2/sensitive-data-exposure.html#access-a-confidential-document',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(16,'dbSchemaChallenge','Database Schema','Injection',NULL,'Exfiltrate the entire DB schema definition via SQL Injection.',3,'Find out where this information could come from. Then craft a UNION SELECT attack string against an endpoint that offers an unnecessary way to filter data.','https://pwning.owasp-juice.shop/part2/injection.html#exfiltrate-the-entire-db-schema-definition-via-sql-injection','https://cheatsheetseries.owasp.org/cheatsheets/SQL_Injection_Prevention_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(17,'deprecatedInterfaceChallenge','Deprecated Interface','Security Misconfiguration','Contraption,Prerequisite','Use a deprecated B2B interface that was not properly shut down.',2,'The developers who disabled the interface think they could go invisible by just closing their eyes.','https://pwning.owasp-juice.shop/part2/security-misconfiguration.html#use-a-deprecated-b2b-interface-that-was-not-properly-shut-down','https://cheatsheetseries.owasp.org/cheatsheets/Web_Service_Security_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(18,'easterEggLevelOneChallenge','Easter Egg','Broken Access Control','Shenanigans,Contraption,Good for Demos','Find the hidden <a href=\"http://en.wikipedia.org/wiki/Easter_egg_(media)\" target=\"_blank\">easter egg</a>.',4,'If you solved one of the three file access challenges, you already know where to find the easter egg.','https://pwning.owasp-juice.shop/part2/broken-access-control.html#find-the-hidden-easter-egg',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(19,'emailLeakChallenge','Email Leak','Sensitive Data Exposure',NULL,'Perform an unwanted information disclosure by accessing data cross-domain.',5,'Try to find and attack an endpoint that responds with user information. SQL Injection is not the solution here.','https://pwning.owasp-juice.shop/part2/sensitive-data-exposure.html#perform-an-unwanted-information-disclosure-by-accessing-data-cross-domain',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(20,'ephemeralAccountantChallenge','Ephemeral Accountant','Injection',NULL,'Log in with the (non-existing) accountant <i>acc0unt4nt@juice-sh.op</i> without ever registering that user.',4,'Try to create the needed user \"out of thin air\".','https://pwning.owasp-juice.shop/part2/injection.html#log-in-with-the-non-existing-accountant-without-ever-registering-that-user','https://cheatsheetseries.owasp.org/cheatsheets/SQL_Injection_Prevention_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(21,'errorHandlingChallenge','Error Handling','Security Misconfiguration','Prerequisite','Provoke an error that is neither very gracefully nor consistently handled.',1,'Try to submit bad input to forms. Alternatively tamper with URL paths or parameters.','https://pwning.owasp-juice.shop/part2/security-misconfiguration.html#provoke-an-error-that-is-neither-very-gracefully-nor-consistently-handled','https://cheatsheetseries.owasp.org/cheatsheets/Error_Handling_Cheat_Sheet.html',1,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:46'),(22,'manipulateClockChallenge','Expired Coupon','Improper Input Validation',NULL,'Successfully redeem an expired campaign coupon code.',4,'Try to identify past special event or holiday campaigns of the shop first.','https://pwning.owasp-juice.shop/part2/improper-input-validation.html#successfully-redeem-an-expired-campaign-coupon-code',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(23,'extraLanguageChallenge','Extra Language','Broken Anti Automation','Brute Force','Retrieve the language file that never made it into production.',5,'Brute force is not the only option for this challenge, but a perfectly viable one.','https://pwning.owasp-juice.shop/part2/broken-anti-automation.html#retrieve-the-language-file-that-never-made-it-into-production',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(24,'feedbackChallenge','Five-Star Feedback','Broken Access Control',NULL,'Get rid of all 5-star customer feedback.',2,'Once you found admin section of the application, this challenge is almost trivial.','https://pwning.owasp-juice.shop/part2/broken-access-control.html#get-rid-of-all-5-star-customer-feedback','https://cheatsheetseries.owasp.org/cheatsheets/Access_Control_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(25,'forgedCouponChallenge','Forged Coupon','Cryptographic Issues','Good for Demos,Code Analysis','Forge a coupon code that gives you a discount of at least 80%.',6,'Try either a) a knowledgable brute force attack or b) reverse engineering or c) some research in the cloud.','https://pwning.owasp-juice.shop/part2/cryptographic-issues.html#forge-a-coupon-code-that-gives-you-a-discount-of-at-least-80','https://cheatsheetseries.owasp.org/cheatsheets/Cryptographic_Storage_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(27,'forgedReviewChallenge','Forged Review','Broken Access Control',NULL,'Post a product review as another user or edit any user\'s existing review.',3,'Observe the flow of product review posting and editing and see if you can exploit it.','https://pwning.owasp-juice.shop/part2/broken-access-control.html#post-a-product-review-as-another-user-or-edit-any-users-existing-review','https://cheatsheetseries.owasp.org/cheatsheets/Access_Control_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(28,'jwtForgedChallenge','Forged Signed JWT','Vulnerable Components',NULL,'Forge an almost properly RSA-signed JWT token that impersonates the (non-existing) user <i>rsa_lord@juice-sh.op</i>.',6,'This challenge is explicitly not about acquiring the RSA private key used for JWT signing.','https://pwning.owasp-juice.shop/part2/vulnerable-components.html#forge-an-almost-properly-rsa-signed-jwt-token','https://cheatsheetseries.owasp.org/cheatsheets/JSON_Web_Token_for_Java_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(29,'forgottenDevBackupChallenge','Forgotten Developer Backup','Sensitive Data Exposure','Contraption,Good for Demos,Prerequisite','Access a developer\'s forgotten backup file.',4,'You need to trick a security mechanism into thinking that the file you want has a valid file type.','https://pwning.owasp-juice.shop/part2/sensitive-data-exposure.html#access-a-developers-forgotten-backup-file',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(30,'forgottenBackupChallenge','Forgotten Sales Backup','Sensitive Data Exposure','Contraption','Access a salesman\'s forgotten backup file.',4,'You need to trick a security mechanism into thinking that the file you want has a valid file type.','https://pwning.owasp-juice.shop/part2/sensitive-data-exposure.html#access-a-salesmans-forgotten-backup-file',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(31,'typosquattingAngularChallenge','Frontend Typosquatting','Vulnerable Components',NULL,'<a href=\"/#/contact\">Inform the shop</a> about a <i>typosquatting</i> imposter that dug itself deep into the frontend. (Mention the exact name of the culprit)',5,'This challenge has nothing to do with mistyping web domains. There is no conveniently misplaced file helping you with this one either. Or is there?','https://pwning.owasp-juice.shop/part2/vulnerable-components.html#inform-the-shop-about-a-typosquatting-imposter-that-dug-itself-deep-into-the-frontend','https://cheatsheetseries.owasp.org/cheatsheets/Vulnerable_Dependency_Management_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(32,'ghostLoginChallenge','GDPR Data Erasure','Broken Authentication',NULL,'Log in with Chris\' erased user account.',3,'Turns out that something is technically and legally wrong with the implementation of the \"right to be forgotten\" for users.','https://pwning.owasp-juice.shop/part2/broken-authentication.html#log-in-with-chris-erased-user-account','https://cheatsheetseries.owasp.org/cheatsheets/User_Privacy_Protection_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(33,'dataExportChallenge','GDPR Data Theft','Sensitive Data Exposure',NULL,'Steal someone else\'s personal data without using Injection.',4,'Trick the regular Data Export to give you more than actually belongs to you.','https://pwning.owasp-juice.shop/part2/sensitive-data-exposure.html#steal-someone-elses-personal-data-without-using-injection','https://cheatsheetseries.owasp.org/cheatsheets/User_Privacy_Protection_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(34,'httpHeaderXssChallenge','HTTP-Header XSS','XSS','Danger Zone','Perform a <i>persisted</i> XSS attack with <code>&lt;iframe src=\"javascript:alert(`xss`)\"&gt;</code> through an HTTP header.',4,'Finding a piece of displayed information that could originate from an HTTP header is part of this challenge.','https://pwning.owasp-juice.shop/part2/xss.html#perform-a-persisted-xss-attack-through-an-http-header','https://cheatsheetseries.owasp.org/cheatsheets/Cross_Site_Scripting_Prevention_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(35,'continueCodeChallenge','Imaginary Challenge','Cryptographic Issues','Shenanigans,Code Analysis','Solve challenge #999. Unfortunately, this challenge does not exist.',6,'You need to trick the hacking progress persistence feature into thinking you solved challenge #999.','https://pwning.owasp-juice.shop/part2/cryptographic-issues.html#solve-challenge-999','https://cheatsheetseries.owasp.org/cheatsheets/Cryptographic_Storage_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(36,'dlpPasswordSprayingChallenge','Leaked Access Logs','Sensitive Data Exposure','OSINT','Dumpster dive the Internet for a leaked password and log in to the original user account it belongs to. (Creating a new account with the same password does not qualify as a solution.)',5,'Once you have it, a technique called \"Password Spraying\" might prove useful.','https://pwning.owasp-juice.shop/part2/sensitive-data-exposure.html#dumpster-dive-the-internet-for-a-leaked-password-and-log-in-to-the-original-user-account-it-belongs-to','https://cheatsheetseries.owasp.org/cheatsheets/Credential_Stuffing_Prevention_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(37,'dlpPastebinDataLeakChallenge','Leaked Unsafe Product','Sensitive Data Exposure','Shenanigans,OSINT','Identify an unsafe product that was removed from the shop and <a href=\"/#/contact\">inform the shop</a> which ingredients are dangerous.',4,'Your own SQLi and someone else\'s Ctrl-V will be your accomplices in this challenge!','https://pwning.owasp-juice.shop/part2/sensitive-data-exposure.html#identify-an-unsafe-product-that-was-removed-from-the-shop-and-inform-the-shop-which-ingredients-are-dangerous',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(38,'typosquattingNpmChallenge','Legacy Typosquatting','Vulnerable Components',NULL,'<a href=\"/#/contact\">Inform the shop</a> about a <i>typosquatting</i> trick it has been a victim of at least in <code>v6.2.0-SNAPSHOT</code>. (Mention the exact name of the culprit)',4,'This challenge has nothing to do with mistyping web domains. Investigate the forgotten developer\'s backup file instead.','https://pwning.owasp-juice.shop/part2/vulnerable-components.html#inform-the-shop-about-a-typosquatting-trick-it-has-been-a-victim-of','https://cheatsheetseries.owasp.org/cheatsheets/Vulnerable_Dependency_Management_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(40,'loginAmyChallenge','Login Amy','Sensitive Data Exposure','OSINT','Log in with Amy\'s original user credentials. (This could take 93.83 billion trillion trillion centuries to brute force, but luckily she did not read the \"One Important Final Note\")',3,'This challenge will make you go after a needle in a haystack.','https://pwning.owasp-juice.shop/part2/sensitive-data-exposure.html#log-in-with-amys-original-user-credentials',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(42,'oauthUserPasswordChallenge','Login Bjoern','Broken Authentication','Code Analysis','Log in with Bjoern\'s Gmail account <i>without</i> previously changing his password, applying SQL Injection, or hacking his Google account.',4,'The security flaw behind this challenge is 100% OWASP Juice Shop\'s fault and 0% Google\'s.','https://pwning.owasp-juice.shop/part2/broken-authentication.html#log-in-with-bjoerns-gmail-account','https://cheatsheetseries.owasp.org/cheatsheets/Authentication_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(43,'loginCisoChallenge','Login CISO','Broken Authentication','Code Analysis','Exploit OAuth 2.0 to log in with the Chief Information Security Officer\'s user account.',5,'Don\'t try to beat Google\'s OAuth 2.0 service. Rather investigate implementation flaws on OWASP Juice Shop\'s end.','https://pwning.owasp-juice.shop/part2/broken-authentication.html#exploit-oauth-20-to-log-in-with-the-cisos-user-account','https://cheatsheetseries.owasp.org/cheatsheets/Authentication_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(45,'loginRapperChallenge','Login MC SafeSearch','Sensitive Data Exposure','Shenanigans,OSINT','Log in with MC SafeSearch\'s original user credentials without applying SQL Injection or any other bypass.',2,'You should listen to MC\'s hit song \"Protect Ya Passwordz\".','https://pwning.owasp-juice.shop/part2/sensitive-data-exposure.html#log-in-with-mc-safesearchs-original-user-credentials',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(46,'loginSupportChallenge','Login Support Team','Security Misconfiguration','Contraption','Log in with the support team\'s original user credentials without applying SQL Injection or any other bypass.',6,'The underlying flaw of this challenge is a lot more human error than technical weakness.','https://pwning.owasp-juice.shop/part2/security-misconfiguration.html#log-in-with-the-support-teams-original-user-credentials','https://cheatsheetseries.owasp.org/cheatsheets/Authentication_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(47,'basketManipulateChallenge','Manipulate Basket','Broken Access Control',NULL,'Put an additional product into another user\'s shopping basket.',3,'Have an eye on the HTTP traffic while placing products in the shopping basket. Changing the quantity of products already in the basket doesn\'t count.','https://pwning.owasp-juice.shop/part2/broken-access-control.html#put-an-additional-product-into-another-users-shopping-basket','https://cheatsheetseries.owasp.org/cheatsheets/Access_Control_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(48,'misplacedSignatureFileChallenge','Misplaced Signature File','Sensitive Data Exposure','Good Practice,Contraption','Access a misplaced <a href=\"https://github.com/Neo23x0/sigma\">SIEM signature</a> file.',4,'You need to trick a security mechanism into thinking that the file you want has a valid file type.','https://pwning.owasp-juice.shop/part2/sensitive-data-exposure.html#access-a-misplaced-siem-signature-file','https://cheatsheetseries.owasp.org/cheatsheets/Logging_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(49,'timingAttackChallenge','Multiple Likes','Broken Anti Automation',NULL,'Like any review at least three times as the same user.',6,'Punctuality is the politeness of kings.','https://pwning.owasp-juice.shop/part2/broken-anti-automation.html#like-any-review-at-least-three-times-as-the-same-user',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(50,'easterEggLevelTwoChallenge','Nested Easter Egg','Cryptographic Issues','Shenanigans,Good for Demos','Apply some advanced cryptanalysis to find <i>the real</i> easter egg.',4,'You might have to peel through several layers of tough-as-nails encryption for this challenge.','https://pwning.owasp-juice.shop/part2/cryptographic-issues.html#apply-some-advanced-cryptanalysis-to-find-the-real-easter-egg',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(51,'noSqlCommandChallenge','NoSQL DoS','Injection','Danger Zone','Let the server sleep for some time. (It has done more than enough hard work for you)',4,'This challenge is essentially a stripped-down Denial of Service (DoS) attack.','https://pwning.owasp-juice.shop/part2/injection.html#let-the-server-sleep-for-some-time','https://cheatsheetseries.owasp.org/cheatsheets/Denial_of_Service_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(52,'no