-juice.shop/part2/xss.html#perform-a-reflected-xss-attack','https://cheatsheetseries.owasp.org/cheatsheets/Cross_Site_Scripting_Prevention_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(62,'passwordRepeatChallenge','Repetitive Registration','Improper Input Validation',NULL,'Follow the DRY principle while registering a user.',1,'You can solve this by cleverly interacting with the UI or bypassing it altogether.','https://pwning.owasp-juice.shop/part2/improper-input-validation.html#follow-the-dry-principle-while-registering-a-user','https://cheatsheetseries.owasp.org/cheatsheets/Input_Validation_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(63,'resetPasswordBenderChallenge','Reset Bender\'s Password','Broken Authentication','OSINT','Reset Bender\'s password via the <a href=\"/#/forgot-password\">Forgot Password</a> mechanism with <i>the original answer</i> to his security question.',4,'Not as trivial as Jim\'s but still not too difficult with some \"Futurama\" background knowledge.','https://pwning.owasp-juice.shop/part2/broken-authentication.html#reset-benders-password-via-the-forgot-password-mechanism','https://cheatsheetseries.owasp.org/cheatsheets/Choosing_and_Using_Security_Questions_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(64,'resetPasswordBjoernChallenge','Reset Bjoern\'s Password','Broken Authentication','OSINT','Reset the password of Bjoern\'s internal account via the <a href=\"/#/forgot-password\">Forgot Password</a> mechanism with <i>the original answer</i> to his security question.',5,'Nothing a little bit of Facebook stalking couldn\'t reveal. Might involve a historical twist.','https://pwning.owasp-juice.shop/part2/broken-authentication.html#reset-the-password-of-bjoerns-internal-account-via-the-forgot-password-mechanism','https://cheatsheetseries.owasp.org/cheatsheets/Choosing_and_Using_Security_Questions_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(65,'resetPasswordJimChallenge','Reset Jim\'s Password','Broken Authentication','OSINT','Reset Jim\'s password via the <a href=\"/#/forgot-password\">Forgot Password</a> mechanism with <i>the original answer</i> to his security question.',3,'It\'s hard for celebrities to pick a security question from a hard-coded list where the answer is not publicly exposed.','https://pwning.owasp-juice.shop/part2/broken-authentication.html#reset-jims-password-via-the-forgot-password-mechanism','https://cheatsheetseries.owasp.org/cheatsheets/Choosing_and_Using_Security_Questions_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(66,'resetPasswordMortyChallenge','Reset Morty\'s Password','Broken Anti Automation','OSINT,Brute Force','Reset Morty\'s password via the <a href=\"/#/forgot-password\">Forgot Password</a> mechanism with <i>his obfuscated answer</i> to his security question.',5,'Find a way to bypass the rate limiting and brute force the obfuscated answer to Morty\'s security question.','https://pwning.owasp-juice.shop/part2/broken-anti-automation.html#reset-mortys-password-via-the-forgot-password-mechanism','https://cheatsheetseries.owasp.org/cheatsheets/Forgot_Password_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(67,'retrieveBlueprintChallenge','Retrieve Blueprint','Sensitive Data Exposure',NULL,'Deprive the shop of earnings by downloading the blueprint for one of its products.',5,'The product you might want to give a closer look is the OWASP Juice Shop Logo (3D-printed).','https://pwning.owasp-juice.shop/part2/sensitive-data-exposure.html#deprive-the-shop-of-earnings-by-downloading-the-blueprint-for-one-of-its-products',NULL,0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(68,'ssrfChallenge','SSRF','Broken Access Control','Code Analysis','Request a hidden resource on server through server.',6,'Reverse engineering something bad can make good things happen.','https://pwning.owasp-juice.shop/pa