ing.owasp-juice.shop/part2/broken-authentication.html#solve-the-2fa-challenge-for-user-wurstbrot','https://cheatsheetseries.owasp.org/cheatsheets/Multifactor_Authentication_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(77,'jwtUnsignedChallenge','Unsigned JWT','Vulnerable Components',NULL,'Forge an essentially unsigned JWT token that impersonates the (non-existing) user <i>jwtn3d@juice-sh.op</i>.',5,'This challenge exploits a weird option that is supported when signing tokens with JWT.','https://pwning.owasp-juice.shop/part2/vulnerable-components.html#forge-an-essentially-unsigned-jwt-token','https://cheatsheetseries.owasp.org/cheatsheets/JSON_Web_Token_for_Java_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(78,'uploadSizeChallenge','Upload Size','Improper Input Validation',NULL,'Upload a file larger than 100 kB.',3,'You can attach a small file to the \"Complaint\" form. Investigate how this upload actually works.','https://pwning.owasp-juice.shop/part2/improper-input-validation.html#upload-a-file-larger-than-100-kb','https://cheatsheetseries.owasp.org/cheatsheets/File_Upload_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(79,'uploadTypeChallenge','Upload Type','Improper Input Validation',NULL,'Upload a file that has no .pdf or .zip extension.',3,'You can attach a PDF or ZIP file to the \"Complaint\" form. Investigate how this upload actually works.','https://pwning.owasp-juice.shop/part2/improper-input-validation.html#upload-a-file-that-has-no-pdf-or-zip-extension','https://cheatsheetseries.owasp.org/cheatsheets/File_Upload_Cheat_Sheet.html',0,NULL,NULL,'2023-05-23 07:36:24','2023-05-23 07:36:24'),(80,'unionSqlInjectionChallenge','User Credentials','Injection',NULL,'Retrieve a list of all user credentials via SQL Injection.',4,'Gather information on where user data is stored and how it is addressed. Then craft a corresponding UNION SELECT attack.','https://pwning.owasp-juice.shop/